SELECT AVG(O_stadium.Stadium_ID) FROM stadium O_stadium WHERE O_stadium.Capacity >= (SELECT AVG(I_stadium.Capacity) FROM stadium I_stadium)
SELECT * FROM singer O_singer WHERE O_singer.Singer_ID <= (SELECT SUM(I_singer.Singer_ID) FROM singer I_singer)
SELECT O_singer.Age, O_singer.Is_male FROM singer O_singer WHERE (O_singer.Country != "'Netherlands'" OR (O_singer.Age >= (SELECT AVG(I_singer.Age) FROM singer I_singer) OR O_singer.Singer_ID = 3))
SELECT COUNT(DISTINCT O_singer.Song_release_year) FROM singer O_singer WHERE (O_singer.Singer_ID >= (SELECT AVG(I_singer.Singer_ID) FROM singer I_singer WHERE ((I_singer.Name = "Joe Sharp" AND I_singer.Singer_ID = 1) AND I_singer.Song_Name NOT LIKE "%angerou")) OR O_singer.Is_male != "'F'")
SELECT O_singer.Name FROM singer O_singer JOIN singer_in_concert O_singer_in_concert ON O_singer.Singer_ID=O_singer_in_concert.Singer_ID WHERE ((O_singer.Singer_ID != 6 AND O_singer_in_concert.concert_ID = (SELECT MIN(I_singer_in_concert.concert_ID) FROM singer_in_concert I_singer_in_concert)) AND O_singer.Song_Name NOT IN "('You','Gentleman','Hey Oh','Sun')")
SELECT SUM(O_stadium.Average), MAX(O_stadium.Capacity) FROM stadium O_stadium WHERE (O_stadium.Capacity <= 11998.0 OR (O_stadium.Capacity > 52500.0 OR O_stadium.Stadium_ID >= (SELECT AVG(I_stadium.Stadium_ID) FROM stadium I_stadium)))
SELECT * FROM stadium O_stadium WHERE O_stadium.Lowest < (SELECT MAX(I_stadium.Lowest) FROM stadium I_stadium)
SELECT O_singer.Song_Name FROM singer O_singer WHERE (O_singer.Song_Name IN "('Hey Oh','Gentleman','Dangerous','Sun')" OR O_singer.Singer_ID < (SELECT MAX(I_singer.Singer_ID) FROM concert I_concert JOIN singer I_singer JOIN singer_in_concert I_singer_in_concert ON I_concert.concert_ID=I_singer_in_concert.concert_ID AND I_singer.Singer_ID=I_singer_in_concert.Singer_ID WHERE (I_concert.Theme NOT LIKE "%choice" OR (I_singer_in_concert.concert_ID != 1.0 OR I_singer.Is_male NOT LIKE "T%"))))
SELECT COUNT(*) FROM singer O_singer WHERE O_singer.Singer_ID > (SELECT MIN(I_singer.Singer_ID) FROM singer I_singer)
SELECT O_singer_in_concert.concert_ID, O_singer_in_concert.Singer_ID FROM singer_in_concert O_singer_in_concert WHERE O_singer_in_concert.concert_ID <= (SELECT AVG(I_singer_in_concert.concert_ID) FROM singer_in_concert I_singer_in_concert)
